import React from 'react';
import './css/main.css';

function Main() {
    return (
        <div style={{ display: 'flex', flex: 1 }}>
            <body className="main-body">
                <img src="../img/background.jpg" />
            </body>
            <footer></footer>
        </div>
    );
}

export default Main;
